import styles from "./CardCovid.module.css";

function CardCovid(props) {
    const { cardcovid } = props;
    return(
        
        <div className={styles.card__coloumn}>
            <h1 className={styles.status}>{cardcovid.status}</h1>
            <p className={styles[cardcovid.status]}>{cardcovid.total}</p>
        </div>
    );
}

export default CardCovid;
